import React, { Component } from 'react';
import Layout from './../../components/Layout/Layout';
import styles from './registerLand.module.css';

class RegisterLand extends Component {
    render() {
        return (
            <Layout>
                <div>
                RegisterLand!!!
                </div>
            </Layout>
        );
    }
}

export default RegisterLand;
